INSERT INTO `llxas_c_incoterms` VALUES (6,'CIF','Cost, Insurance, Freight','Cost, Insurance and Freight, loaded on the boat, costs to the port of arrival, with the transported goods insurance taken out by the seller on behalf of the buyer',1);
