INSERT INTO `llxas_c_incoterms` VALUES (8,'CIP','Carriage Insurance Paid','Carriage and Insurance Paid to, idem CPT, with transported goods insurance taken out by the seller on behalf of the buyer',1);
INSERT INTO `llxas_c_incoterms` VALUES (9,'DAT','Delivered At Terminal','Delivered At Terminal, goods (unloaded) delivered to the quay, to a designated maritime, river, air, road or rail terminal (import customs clearance and post-routing paid by the buyer)',1);
INSERT INTO `llxas_c_incoterms` VALUES (10,'DAP','Delivered At Place','Delivered At Place, goods (not unloaded) made available to the buyer in the country of importation at the place specified in the contract (unloading, import customs clearance paid by the buyer)',1);
INSERT INTO `llxas_c_incoterms` VALUES (11,'DDP','Delivered Duty Paid','Delivered Duty Paid, goods (not unloaded) delivered to final destination, import customs clearance and taxes payable by the seller; the buyer pays only for the unloading (if VAT-type taxes are excluded, specify this clearly)',1);
INSERT INTO `llxas_c_incoterms` VALUES (12,'DPU','Delivered at Place Unloaded','Delivered at Place unloaded',1);
